import React from 'react';
import './App.css';
import {Container, Row, Col} from 'reactstrap'

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>
            <h1>Image</h1>
          </Col>
          <Col>
            <p>price</p>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
